import styled from "styled-components";

const CartStyle = styled.div`
  padding: 200px 500px;

  .products {
    display: flex;
    justify-content: space-between;
    align-items: center;

    .pizza-img {
      flex-basis: 20%;
      border: 1px solid #000;
      img {
        width: 100%;
        height: 200px;
        border: 1px solid #000;
      }
    }
  }
`;

export default CartStyle;
